import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Nav from './components/Nav';
import Home from './pages/Home';
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Router>

        <Nav />
        <Home />
        <Footer />

        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/about">
            <AboutUs />
          </Route>
          <Route path="/contact">
            <ContactUs />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
        </Switch>

      </Router>
    </>
  );
}

export default App;
